import { ConnectWallet, Provider, NETWORKS } from '@web3-ui/core';
import Wrapper from "./Wrapper";

function App() {
  return (
    <Provider network={NETWORKS.mainnet}>
      <div className="flex flex-col items-center justify-center bg-brand-gradient w-full h-screen p-16 pt-8">
        <nav className="flex flex-row mb-8 self-end">
          <h2 className="text-4xl text-white">10k digits</h2>
          <ConnectWallet />
        </nav>
        <Wrapper/>
      </div>
    </Provider>
  );
}

export default App;
